      out.write("<!-- 图片轮播  js-->\t    \r\n");
      out.write("<script>\r\n");
      out.write("$(function() {\r\n");
      out.write("\tvar sWidth =$(\"#focus\").width();//获取焦点图的宽度（显示面积）\r\n");
      out.write("\t$(\"#focus\").find(\"a\").css(\"width\", sWidth+\"px\"); //设置图片宽度\r\n");
      out.write("\tvar len = $(\"#focus ul li\").length; //获取焦点图个数\r\n");
      out.write("\tvar index = 0;\r\n");
      out.write("\tvar picTimer;\r\n");
      out.write("\t\r\n");
      out.write("\t//以下代码添加数字按钮和按钮后的半透明条，还有上一页、下一页两个按钮\r\n");
      out.write("\tvar btn = \"<div class='btnBg'></div><div class='btn'>\";\r\n");
      out.write("\tfor(var i=0; i < len; i++) {\r\n");
      out.write("\t\tbtn += \"<span></span>\";\r\n");
      out.write("\t}\r\n");
      out.write("\tbtn += \"</div>\";\r\n");
      out.write("\t\r\n");
      out.write("\t$(\"#focus\").append(btn);\r\n");
      out.write("\t$(\"#focus .btnBg\").css(\"opacity\",0.5);\r\n");
      out.write("\t\r\n");
      out.write("\t//为小按钮添加鼠标滑入事件，以显示相应的内容\r\n");
      out.write("\t$(\"#focus .btn span\").css(\"opacity\",0.4).mouseover(function() {\r\n");
      out.write("\t\tindex = $(\"#focus .btn span\").index(this);\r\n");
      out.write("\t\tshowPics(index);\r\n");
      out.write("\t}).eq(0).trigger(\"mouseover\");\r\n");
      out.write("\t\r\n");
      out.write("\t//本例为左右滚动，即所有li元素都是在同一排向左浮动，所以这里需要计算出外围ul元素的宽度\r\n");
      out.write("\t$(\"#focus ul\").css(\"width\",sWidth * (len));\r\n");
      out.write("\t\r\n");
      out.write("\t//鼠标滑上焦点图时停止自动播放，滑出时开始自动播放\r\n");
      out.write("\t$(\"#focus\").hover(function() {\r\n");
      out.write("\t\tclearInterval(picTimer);\r\n");
      out.write("\t},function() {\r\n");
      out.write("\t\tpicTimer = setInterval(function() {\r\n");
      out.write("\t\t\tshowPics(index);\r\n");
      out.write("\t\t\tindex++;\r\n");
      out.write("\t\t\tif(index == len) {\r\n");
      out.write("\t\t\t  index = 0;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t},4000); //此4000代表自动播放的间隔，单位：毫秒\r\n");
      out.write("\t}).trigger(\"mouseleave\");\r\n");
      out.write("\t\r\n");
      out.write("\t//显示图片函数，根据接收的index值显示相应的内容\r\n");
      out.write("\tfunction showPics(index) { //普通切换\r\n");
      out.write("\t\tvar nowLeft = -index*sWidth; //根据index值计算ul元素的left值\r\n");
      out.write("\t\t$(\"#focus ul\").stop(true,false).animate({\"left\":nowLeft},300); //通过animate()调整ul元素滚动到计算出的position\r\n");
      out.write("\t\t$(\"#focus .btn span\").stop(true,false).animate({\"opacity\":\"0.4\"},300).eq(index).stop(true,false).animate({\"opacity\":\"1\"},300); //为当前的按钮切换到选中的效果\r\n");
      out.write("\t}\r\n");
      out.write("});\r\n");
